import React from 'react';
import {Router, Switch, Route, Link} from 'react-router-dom'


function Nav(){
    return (
        <Router>
            <div>
                <ul>
                    <li>
                        <Link to="Weather.js">Weather</Link>
                    </li>
                    <li>
                        <Link to="Fiveday.js">5 Day Forecast</Link>
                    </li>
                </ul>
            </div>

        //     <Switch>
        //         <Route path="/Weather.js"></Route>
        //         <Route path="/Fiveday.js"></Route>
        //     </Switch>

         </Router>
    )
}
export default Nav;
